import React from 'react';
import { useNavigate } from 'react-router-dom';
import styles from '../styles/Dashboard.module.css';

function Dashboard() {
    const navigate = useNavigate();

    const handleNavigateToDishForm = () => {
        navigate('/dish-form');
    };

    return (
        <div className={styles.dashboardContainer}>
            <h1>Painel de Controle</h1>
            <button onClick={() => navigate('/dish-form')} className={styles.btnOption}>Cadastrar Prato</button>
            <button onClick={() => navigate('/supplier-form')} className={styles.btnOption}>Cadastrar Fornecedor</button>
            <button className={styles.optionButton}>Opção 3</button>
            <button className={styles.optionButton}>Opção 4</button>
            <button className={styles.optionButton}>Opção 5</button>
        </div>
    );
}

export default Dashboard;
